2803887722080936828=<ph name="BEGIN_H3">Ciri Penyahpepijatan<ph name="END_H3"><br>    <ph name="BR"><br>    Anda boleh mendayakan ciri penyahpepijatan pada Peranti OS Chrome bagi memasang dan menguji kod peribadi pada peranti anda.  Ini akan membolehkan anda untuk:<ph name="BR"><br>    <ph name="BEGIN_LIST"><br>      <ph name="LIST_ITEM">Mengalih keluar pengesahan rootfs supaya anda boleh mengubah fail OS<br>      <ph name="LIST_ITEM">Mendayakan akses SSH kepada peranti menggunakan kunci ujian standard supaya anda boleh menggunakan alatan seperti <ph name="BEGIN_CODE">'cros flash'<ph name="END_CODE"> untuk mengakses peranti<br>      <ph name="LIST_ITEM">Mendayakan pengebutan dari USB supaya anda boleh memasang imej OS dari pemacu USB<br>      <ph name="LIST_ITEM">Menetapkan kedua-dua kata laluan log masuk dev dan akar sistem kepada nilai peribadi supaya anda boleh SSH kepada peranti secara manual<br>    <ph name="END_LIST"><br>    <ph name="BR"><br>    Setelah didayakan, kebanyakan ciri penyahpepijatan akan kekal didayakan walaupun selepas melakukan powerwash atau penyapuan data pada peranti diurus perusahaan.  Untuk melumpuhkan sepenuhnya semua ciri penyahpepijatan, sila lengkapkan proses pemulihan OS Chrome (https://support.google.com/chromebook/answer/1080595).<br>    <ph name="BR"><br>    <ph name="BR"><br>    Untuk maklumat lanjut tentang ciri penyahpepijatan sila lihat:<ph name="BR"><br>    http://www.chromium.org/chromium-os/how-tos-and-troubleshooting/debugging-features<br>    <ph name="BR"><br>    <ph name="BR"><br>    <ph name="BEGIN_BOLD">Nota:<ph name="END_BOLD">  Sistem akan mengebut semula semasa proses ini.</ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph></ph>
